import React from 'react';
import './ConvertPanel.css';
import Icon from '../../assets/Icon.svg';

function ConvertPanel() {
    return (
        <div className="container">
            <div className="convertPanelBox">
                <div className="convertPanelBox-a">
                    <a>convert</a>
                </div>
                <div className="convertPanelBox-selects-container">
                    <div className="convertPanelBox-select-box">
                        <select className="select" defaultValue={'km -> miles'}>
                            <option>km -> miles</option>
                            <option>miles -> km</option>
                        </select>
                    </div>
                    <div className="convertPanelBox-select-box-button">
                        <button>
                            <img src="../../assets/Icon.svg" width="12" height="12"/>
                        </button>
                    </div>
                    <div className="convertPanelBox-select-box"></div>

                </div>
            </div>
        </div>
    );
}

export default ConvertPanel;
